import React from 'react';
import styled from 'styled-components';

const AboutContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background: #f0f0f0;
`;

const About = () => {
  return (
    <AboutContainer>
      <h1>About Me</h1>
      <p>This is the About Page.</p>
    </AboutContainer>
  );
};

export default About;
